import React from 'react';


const outOf = 3*4



const PlayerSingle = (props) => {
    return ( 
        <div className="row">
            <div className="col s12 m7">
                <div className="card">
                    <div className="card-image">
                        <img src="1.jpg"/>
                        <span className="card-title">{props.player.firstName} {props.player.lastName}</span>
                    </div>

                    <div className="card-content">
                        <p>{runable(props.player.phone)}</p>
                        <p>Email:{props.player.email}</p>
                        <p>Rating:{ratingFunction(props.player.shooting,
                            props.player.speed,
                            props.player.offense,
                            props.player.defense)}/{outOf}</p>
                    </div>

                    <div className="card-action">
                        <a href="#">This is a link</a>
                    </div>
                </div>
            </div>
        </div>
     );
}

let information = []
export default PlayerSingle;

function testFun(passed){
    if(passed != null){
        information = ["phone", true]
    }
}

function runable(passed){
    testFun(passed)
    if(information[1] === true){
        information = []
        return `Phone: ${passed}`
    }
}

